import React from 'react'
import './Category.css';
import category_product from '../Assets/category'
import CategoryCard from './CategoryCard';

export const Category = () => {
  return (
    <div id="categories">
        <div className="title">
            <h2>Categories</h2>
        </div>
        <div className="categories-container container">
            {
                category_product.map((category,i) => {
                    return <CategoryCard key={i} id={category.id} name={category.name} image={category.image}/>
                })
            }
            <div>
                <h1>hello</h1>
            </div>

        </div>

    </div>
  )
}
